import React from "react";
import VideoItem from "./VideoItem";
import Spinner from './Component/Spinner'

const VideoList = ({videos,onVideoSelect}) => {

    const giivingvalue=()=>{
      onVideoSelect
    };
  const List=videos.map(
      (vid,index)=>{
        return (
            <VideoItem
            key={index}
            video={vid}
            onVideoSelect={giivingvalue}
        />)
      }
  );

if(videos.length!==0 && onVideoSelect)
  return <div className=" container ui relaxed divided list">{List}</div>;
    else
        return(<Spinner/>)

    };

export default VideoList;
